import React, { useState } from 'react';

function App() {
  const [isListening, setIsListening] = useState(false);

  // Dummy chat history
  const dummyChats = [
    { id: 1, text: "Hello, how can I help you today?", isUser: false },
    { id: 2, text: "What's the weather like?", isUser: true },
    { id: 3, text: "It's currently 72�F and sunny in your location.", isUser: false },
    { id: 4, text: "Thanks! Set a reminder for my meeting at 3pm", isUser: true },
    { id: 5, text: "I've set a reminder for your meeting at 3:00 PM today.", isUser: false },
  ];

  // Toggle listening state
  const toggleListening = () => {
    setIsListening(!isListening);
  };

  // Generate voice bars for animation
  const generateVoiceBars = () => {
    const bars = [];
    const numberOfBars = 30;

    for (let i = 0; i < numberOfBars; i++) {
      const height = isListening ? Math.floor(Math.random() * 40) + 5 : 5;
      bars.push(
        <div 
          key={i} 
          className={`bar ${!isListening ? 'voice-bar-inactive' : ''}`}
          style={{ height: `${height}px` }}
        />
      );
    }

    return bars;
  };

  return (
    <div className="flex h-screen bg-white">
      {/* Chat History Sidebar */}
      <div className="hidden md:block md:w-1/3 border-r border-gray-200">
        <div className="p-4 border-b border-gray-200">
          <h2 className="text-lg font-medium text-gray-800">Recent Chats</h2>
        </div>
        <div className="p-4">
          {dummyChats.map(chat => (
            <div 
              key={chat.id} 
              className={`chat-bubble ${chat.isUser ? 'user-bubble' : 'assistant-bubble'}`}
            >
              {chat.text}
            </div>
          ))}
        </div>
      </div>

      {/* Main Voice Assistant UI */}
      <div className="flex-1 flex flex-col items-center justify-center p-6">
        <div className="w-full max-w-md">
          <div className="text-center mb-8">
            <h1 className="text-2xl font-bold text-gray-800 mb-2">Voice Assistant</h1>
            <p className="text-gray-600">
              {isListening ? "I'm listening..." : "Click the button to speak"}
            </p>
          </div>

          {/* Voice Animation */}
          <div className="voice-wave mb-8">
            {generateVoiceBars()}
          </div>

          {/* Mic Button */}
          <button
            onClick={toggleListening}
            className="mx-auto flex items-center justify-center w-16 h-16 rounded-full bg-blue-500 hover:bg-blue-600 text-white shadow-lg transition-colors"
          >
            <svg 
              xmlns="http://www.w3.org/2000/svg" 
              width="24" 
              height="24" 
              viewBox="0 0 24 24" 
              fill="none" 
              stroke="currentColor" 
              strokeWidth="2" 
              strokeLinecap="round" 
              strokeLinejoin="round"
            >
              {isListening ? (
                <>
                  <line x1="1" y1="1" x2="23" y2="23"></line>
                  <path d="M9 9v3a3 3 0 0 0 5.12 2.12M15 9.34V4a3 3 0 0 0-5.94-.6"></path>
                  <path d="M17 16.95A7 7 0 0 1 5 12v-2m14 0v2a7 7 0 0 1-.11 1.23"></path>
                  <line x1="12" y1="19" x2="12" y2="23"></line>
                  <line x1="8" y1="23" x2="16" y2="23"></line>
                </>
              ) : (
                <>
                  <path d="M12 1a3 3 0 0 0-3 3v8a3 3 0 0 0 6 0V4a3 3 0 0 0-3-3z"></path>
                  <path d="M19 10v2a7 7 0 0 1-14 0v-2"></path>
                  <line x1="12" y1="19" x2="12" y2="23"></line>
                  <line x1="8" y1="23" x2="16" y2="23"></line>
                </>
              )}
            </svg>
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
